The pleasures of osculation reach new heights in the fourth volume of Girls Kissing Girls - Young Lesbians in Love. Featuring all young, beautiful girls who love to french kiss, bite and suck on each other's lips and tongue -- and everywhere ...    Full Descriptionelse! Mia Presley is worried when Kristina Rose returns from a hot date looking sad and dejected. When Kristina confides that her date told her she 'can't kiss,' Mia takes matters into her own hands, with some scorchingly hot results! Next, teenage blonde Nicole Ray challenges exotic beauty Jessica Bangkok to a friendly game of pool. But when Nicole tells Jessica the loser has to be the winner's slave, will Jessica run, or submit to lesbian pleasures she's never known before? Samantha Ryan is fed up with Alyssa Reece's flirting with ex-lovers, but when a pleading Alyssa finally gives up hope, will Samantha choose hot make up sex instead of a break up? And finally, newly recovered Sinn Sage returns from her snowboarding accident a slightly different person - for one thing, her hair is shorter. She confides her insecurities to Elexis, who responds by showing her that there's one thing she can always count on -- Elexis' sapphic love.
